import React from 'react'
import Slider from '../components/Slider'
import Stepper from '../components/Stepper'

const HomePage = () => {
  return (
    <div className='container'>
      <Slider/>
      <div style={{marginTop: 200}}></div>
      <Stepper/>
    </div>
  )
}

export default HomePage
